Properties.Header:
{% stylesheet %}
.workflow-entry-panel {
    background-color: white;
    height: 600px;
    display: flex;
    flex-direction: column;
}
.messages {
    flex-grow: 1;
    padding: 15px;
    overflow-y: auto;
}

.message {
    margin-bottom: 20px;
    font-size: 16px;
    max-width: 70%;
    padding: 10px;
    border-radius: 20px;
    clear: both;
}

.message.sent {
    background-color: #0B93F6;
    color: white;
    float: right;
}

.message.received {
    background-color: #E5E5EA;
    float: left;
}

.message.error {
    background-color: #ffa705;
    float: left;
}
{% endstylesheet %}
{%- assign Title = CurrentPerson | Attribute:'StaffTitle' | Default:'staff member' | Escape -%}
<div class="messages" id="messages">
        <div class="message sent">
            <p>Hello! My role is to assist the staff of {{ 'Global' | Attribute:'OrganizationName' }}</p>
            <p>My knowledge is based on what is found on the internet as of September 2021 and as such is not perfect. Do not rely on my responses for facts but instead for inspiration.</p>
            <p>A great prompt to start with is "What are some creative ways that you can best help me? Provide some example prompts." and I will give some creative ideas. </p>
        </div>
    {% capture expression %}```([^`]+)```{% endcapture %}

    {% assign PastActivities = Workflow.Activities | OrderBy:'ActivatedDateTime' %}
    {% for PastActivity in PastActivities %}
        {% if PastActivity.IsActive == false and PastActivity.ActivityTypeId == Activity.ActivityTypeId %}
            {% assign question = PastActivity | Attribute:'Question' %} 
            {% assign response = PastActivity | Attribute:'Response' %} 
            {% assign errorMessage = PastActivity | Attribute:'ErrorMessage' %} 
            <div class="message sent">
                {{ question }}
            </div>
            {% if response != '' %}
                 <div class="message received">
                    {{ response | RegExReplace:expression,'<pre>$1</pre>' }}
                </div>
            {% endif %}
            {% if errorMessage != '' %}
                 <div class="message error">
                    {{ errorMessage }}
                </div>
            {% endif %}
        {% endif %}
    {% endfor %}
</div>

