{%- assign openAIKey = 'PLACEYOURKEYHERE'  -%}

/- Implement this method if you would prefer to store your key in a secure global variable.
    {%- attributevalue where:'AttributeId == PLACEATTRIBUTEIDHERE' limit:'1' securityenabled:'false' -%}
        {%- assign openAIKey = attributevalue.Value | Decrypt  -%}
    {%- endattributevalue -%}
-/

//- Update role with whatever works best your implementation. Additional detail helps to set tone and include data, but also adds tokens.
{% capture aiRole -%}
    Assist {{ 'Global' | Attribute:'OrganizationName' }} ({{ 'Global' | Attribute:'OrganizationWebsite' | Remove:'https://' }}) staff.
{%- endcapture %}

//- Model Names and Tokens available at:https://platform.openai.com/docs/models/overview 
{%- assign modelName = 'gpt-3.5-turbo' -%}
{%- assign modelMaxTokens = 4096 -%}

{%- assign newCompletionAllowance = 1000 -%}


//- You shouldn't need to edit anything below this comment.

//- Determine which previous prompts can be included in the request while staying under the token usage
{%- assign aiRole = aiRole | Trim | StripNewlines | Escape %}
{%- assign newPromptTokens = Activity | Attribute:'Question' | StripNewlines | Escape | Size | DividedBy:3.5 | AsInteger -%}
{%- assign roleTokens = aiRole | Size | DividedBy:3.5 | AsInteger -%}
{%- assign tokenAllowance = modelMaxTokens | Minus:newCompletionAllowance | Minus:newPromptTokens | Minus:roleTokens -%}
{%- assign previousActivityValidIds = '|' %}

{%- for previousActivity in Workflow.Activities reversed-%}
    {%-  assign previousActivityCompletionTokens = previousActivity | Attribute:'CompletionTokens'| Default:'0' | AsInteger -%}
    {%-  assign previousActivityPromptTokens = previousActivity | Attribute:'Question' | StripNewlines | Escape | Size | DividedBy:3.75 | Default:'0' | AsInteger  -%}

    {%- if previousActivity.IsActive == false and Activity.ActivityTypeId == previousActivity.ActivityTypeId and previousActivityCompletionTokens != 0 and previousActivityPromptTokens != 0 -%}
        {%-  assign tokenAllowance = tokenAllowance | Minus: previousActivityCompletionTokens | Minus: previousActivityPromptTokens -%}
        {%- if tokenAllowance > 0 -%}
            {%- assign previousActivityValidIds = previousActivityValidIds | Append:  previousActivity.Id | Append:'|' -%}
        {%- else %}
            {%- break -%}
        {%- endif -%}
    {%- endif -%}
{%- endfor -%}

//- Capture the request body
{%- capture aiwebrequestbodycapture -%}
    {
      "model": "gpt-3.5-turbo",
      "messages": [
        {"role": "system", "content": "{{ aiRole }}"},
        {%- for PastActivity in Workflow.Activities -%}
            {% assign pastActivityIdToCheck = '|' | Append: PastActivity.Id | Append: '|' %}
            {%- if previousActivityValidIds contains pastActivityIdToCheck -%}
                {%- assign question = PastActivity | Attribute:'Question' | StripNewlines | Escape -%}
                {%- assign response = PastActivity | Attribute:'Response' | StripNewlines | Escape -%}
                {%- if question != '' and response != '' -%}
                    {"role": "user", "content": "{{ question }}"},
                    {"role": "assistant", "content": "{{ response }}"},
                {% endif %}
            {%- endif -%}
        {%- endfor -%}
        {"role": "user", "content": "{{ Activity | Attribute:'Question' | StripNewlines | Escape }}"}
        ]
    }
{%- endcapture -%}
{%- assign aiwebrequestbodytrimmed = aiwebrequestbodycapture | Trim -%}

//- Send the request
{%- webrequest url:'https://api.openai.com/v1/chat/completions' headers:'Authorization^Bearer {{ openAIKey }}' method:'POST' body:'{{aiwebrequestbodytrimmed }}' requestcontenttype:'application/json' timeout:'60000'-%}
    {{- results | ToJSON -}}
{%- endwebrequest -%}

